import classes from "./Table.module.css";
const UserList = ({ users }) => {
  return users.map(
    (user = (
      <div className={classes.user}>
        <span>{user.name}</span>
        <span>{user.email}</span>
        <span>{user.birthdate}</span>
        <span>{user.department}</span>
      </div>
    ))
  );
};
export default UserList;
